class Company extends React.Component {



    render() {
        return (
            <div>
                {/* <h1>{this.state.ticker}</h1> */}
                <Plot
                    data={[
                    {
                        x: this.state.stockChartXValues,
                        y: this.state.stockChartYValues,
                        type: 'scatter',
                        mode: 'lines+markers',
                        marker: {color: 'black'},
                    },

                    ]}
                    layout={ {width: 700, height: 500, title: this.state.ticker} }
                />
            </div>
        )
    }

}

export default Company;
